import React, { useState } from "react";
import "./styles/Demographic.css";
import Select from "react-select";
import countries from "./Countries";

const DemographicCollection = ({
  finishGame,
  setDemographics,
  sendToDemographicData,
  setOutputData,
}) => {
  const [gender, setGender] = useState("");
  const [age, setAge] = useState("");
  const [race, setRace] = useState("");
  const [country, setCountry] = useState("");
  const [income, setIncome] = useState("");
  const [tech, setTech] = useState("");
  const [education, setEducation] = useState("");
  const handleSubmit = (event) => {
    event.preventDefault();

    const demographicData = {
      Gender: gender,
      Age: age,
      Race: race,
      Country: country,
      Income: income,
      Tech: tech,
      Education: education,
    };

    setDemographics(demographicData);
    sendToDemographicData.demographics = demographicData;
    setOutputData(sendToDemographicData);

    finishGame();
  };

  const allFieldsFilled = gender && age && race && country && tech && education;
  const customStyles = {
    control: (provided, state) => ({
      ...provided,
      width: "40vw",
      // padding: "0em",
      marginBottom: "1em",
      fontFamily: "Montserrat",
      borderRadius: "1em",
      margin: ".2em 4vw",
      color: "black",
      fontSize: "calc(.6rem + .7vw)",
    }),
    singleValue: (provided, state) => {
      const textAlign = "left";
      return { ...provided, textAlign };
    },
  };

  const genders = [
    { value: "", label: "Select Gender" },
    { value: "Male", label: "Male" },
    { value: "Female", label: "Female" },
    { value: "Non-binary/ third gender", label: "Non-binary/ third gender" },
    { value: "Other", label: "Other" },
    { value: "Prefer not to say", label: "Prefer not to say" },
  ];

  const ages = [
    { value: "", label: "Select Age Range" },
    { value: "<18", label: "Under 18" },
    { value: "18-24", label: "18-24" },
    { value: "25-34", label: "25-34" },
    { value: "35-44", label: "35-44" },
    { value: "45-54", label: "45-54" },
    { value: "55-64", label: "55-64" },
    { value: "65+", label: "65+" },
  ];

  const educations = [
    { value: "", label: "Select Education Level" },
    { value: "Some Primary Education", label: "Some Primary Education" },
    { value: "Completed Primary", label: "Completed Primary" },
    { value: "Some Secondary Education", label: "Some Secondary Education" },
    { value: "Completed Secondary", label: "Completed Secondary" },
    { value: "Vocational or Similar", label: "Vocational or Similar" },
    {
      value: "Some university but no degree",
      label: "Some university but no degree",
    },
    {
      value: "University Bachelors degree",
      label: "University Bachelors degree",
    },
    {
      value: "Graduate or professional degree (MA, MS, MBA, PhD, JD, MD, DDS)",
      label: "Graduate or professional degree (MA, MS, MBA, PhD, JD, MD, DDS)",
    },
    { value: "Prefer not to say", label: "Prefer not to say" },
  ];

  const races = [
    { value: "", label: "Select Ethnicity" },
    { value: "White", label: "White" },
    { value: "Black", label: "Black/African/Caribbean" },
    {
      value: "Asian",
      label:
        "Asian (Indian, Pakistani, Bangladeshi, Chinese, any other Asian background)",
    },
    { value: "Hispanic", label: "Hispanic" },
    { value: "Mixed", label: "Mixed two or more ethnic groups" },
    { value: "Other", label: "Other (Arab or any others)" },
    { value: "Prefer not to say", label: "Prefer not to say" },
  ];

  const techs = [
    { value: "", label: "Select Tech Experience" },
    { value: "Beginner", label: "Beginner" },
    { value: "Intermediate", label: "Intermediate" },
    { value: "Expert", label: "Expert" },
  ];

  return (
    <div className="demographicQuestions">
      <h2>
        Please fill out the following demographic information to see your
        results:
      </h2>
      <form onSubmit={handleSubmit}>
        <select value={gender} onChange={(e) => setGender(e.target.value)}>
          <option value="">Select Gender</option>
          <option value="Male">Male</option>
          <option value="Female">Female</option>
          <option value="Non-binary/ third gender">
            Non-binary/ third gender
          </option>
          <option value="Other">Other</option>
          <option value="Prefer not to say">Prefer not to say</option>
        </select>

        <select value={age} onChange={(e) => setAge(e.target.value)}>
          <option value="">Select Age Range</option>
          <option value="<18">Under 18</option>
          <option value="18-24">18-24</option>
          <option value="25-34">25-34</option>
          <option value="35-44">35-44</option>
          <option value="45-54">45-54</option>
          <option value="55-64">55-64</option>
          <option value="65+">65+</option>
        </select>

        <select
          value={education}
          onChange={(e) => setEducation(e.target.value)}
        >
          <option value="">Select Education Level</option>
          <option value="Some Primary Education">Some Primary Education</option>
          <option value="Completed Primary">Completed Primary</option>
          <option value="Some Secondary Education">
            Some Secondary Education
          </option>
          <option value="Completed Secondary">Completed Secondary</option>
          <option value="Vocational or Similar">Vocational or Similar</option>
          <option value="Some university but no degree">
            Some university but no degree
          </option>
          <option value="University Bachelors degree">
            University Bachelors degree
          </option>
          <option value="Graduate or professional degree (MA, MS, MBA, PhD, JD, MD, DDS)">
            Graduate or professional degree (MA, MS, MBA, PhD, JD, MD, DDS)
          </option>
          <option value="Prefer not to say">Prefer not to say</option>
        </select>

        <select value={race} onChange={(e) => setRace(e.target.value)}>
          <option value="">Select Ethnicity</option>
          <option value="White">White</option>
          <option value="Black">Black/African/Caribbean</option>
          <option value="Asian">
            Asian (Indian, Pakistani, Bangladeshi, Chinese, any other Asian
            background)
          </option>
          <option value="Hispanic">Hispanic</option>
          <option value="Mixed">Mixed two or more ethnic groups</option>
          <option value="Other">Other (Arab or any others)</option>
          <option value="Prefer not to say">Prefer not to say</option>
        </select>

        <select value={tech} onChange={(e) => setTech(e.target.value)}>
          <option value="">Select Tech Experience</option>
          <option value="Beginner">Beginner</option>
          <option value="Intermediate">Intermediate</option>
          <option value="Expert">Expert</option>
        </select>

        <Select
          className="countrySelect"
          styles={customStyles}
          options={countries}
          value={countries.find((obj) => obj.value === country)}
          onChange={(selectedOption) => setCountry(selectedOption.value)}
          isSearchable
        />
      </form>
      {allFieldsFilled && (
        <button className="demographicButton" onClick={handleSubmit}>
          See your Results!
        </button>
      )}
    </div>
  );
};

export default DemographicCollection;
